class Solution:
    def minimumMoves(self, n: int, socks: List[int]) -> int:
        # sort the socks in ascending order
        socks.sort()

        # count the number of types of socks
        type_count = {}
        for sock in socks:
            if sock in type_count:
                type_count[sock] += 1
            else:
                type_count[sock] = 1

        # number of socks of each type
        num_sock_of_type = [0] * n

        # perform the pairs of socks until there is only one type left
        for i in range(n - 1):
            for j in range(i + 1, n):
                # if the two socks are of the same type, pair them
                if type_count[socks[i]] == type_count[socks[j]]:
                    # increment the number of socks of the same type in the original piles
                    num_sock_of_type[i] += 1
                    num_sock_of_type[j] += 1
                    # break the loop
                    break

        # return the minimum number of moves
        min_moves = n
        for i in range(n):
            if num_sock_of_type[i] < min_moves:
                min_moves = num_sock_of_type[i]

        return min_moves

